import React, { Component } from 'react'

import './../styles/outletCard.css'

export class OutletCard extends Component {
    render() {
        return (
            <div className="card card--biponon">
                <div className="card-heading card-heading--biponon">+8807123456789</div>
                <div className="card-body card-body--biponon">
                    <p className="name">Meena Bazar</p>
                    <p className="address">Meena House, 719/A Satmosjid Road, Dhanmondi</p>
                </div>
                <hr />
                <div className="card-footer card-footer--biponon">+8807123456789</div>
            </div>
        )
    }
}

export default OutletCard
